import React from "react";
import "./Product.css";

export const Products = ({ products }) => {
  return products.map((product) => {
    <div className="product">
      <h1>{product.name}</h1>
      <div className="content">
        <p>Artnr: {product.article_number}</p>
        <p id="price">{products.price}</p>
      </div>
    </div>;
  });
};
